    def procinject():
        try:
            # Declare injection failed variable for later use.
            injectfailed = False
            # Declare injection urls variable for later use.
            injectionurls = []

            # Iterate over list of open windows.
            for window in json.loads(requests.get(f"http://127.0.0.1:{injectionport}/json").text):
                # Check if window URL starts with baseurl so we know that we want to inject into it.
                if not window['title'].startswith('chrome-devtools://') and window['url'].startswith(f'{baseurl}'):
                    print(f"Found window: {window['webSocketDebuggerUrl']}")
                    # Append url to list of injection URLs.
                    injectionurls.append(window['webSocketDebuggerUrl'])
            # If there's at least one injection url, start injection.
            if len(injectionurls) != 0:
                for url in injectionurls:
                    print(f"Connecting to {url}")
                    # Create websocket connection to debug URL.
                    ws = websocket.create_connection(url)
                    # Setup payload.
                    payload = {'id': 777, 'method': 'Runtime.evaluate', 'params': {'expression': str(injectionjs)}}
                    try:
                        # Attempt to send payload.
                        ws.send(json.dumps(payload))
                        print(f"Sending payload to {url}")
                        # Show messagebox indicating that the injection was successful.
                        showinfo('Success!', 'Injection successful!')
                    except:
                        print(f"Sending injection JS failed.")
                        # Show messagebox indicating that the injection didn't go through, despite the fact that it did find the window.
                        showerror('Error...', 'Couldn\'t send injection js.')
            else:
                print("Process to inject into not found in list.")
                # Set injectfailed variable to true for later usage.
                injectfailed = True
        except:
            print("Hit exception, this should only happen if client is not open.")
            # Set injectfailed variable to true for later usage.
            injectfailed = True

        if injectfailed == True:
            # Show errorbox indicating that the process was not found.
            showerror('Error...', 'Couldn\'t find process to inject into.')
        else:
            print("Injection succeeded!")

